package easy

import "testing"

func TestFindTheDifference(t *testing.T) {
	type Case struct {
		s      string
		t      string
		expect byte
	}
	cases := []Case{
		{
			s:      "",
			t:      "",
			expect: 't'},
		{"a", "aa", 'a'},
		{"abcd", "abcde", 'e'},
		{"", "y", 'y'},
	}

	for _, item := range cases {
		if got := findTheDifference(item.s, item.t); got != item.expect {
			t.Errorf("Wrong with the case : %v, got:%s", item, string(got))
		}
	}
}
